import { useEffect, useState, useContext, ChangeEvent } from "react";
import API from "../api/axios";
import { AuthContext } from "../context/AuthContext";

interface Document {
    id: number;
    projectId: number;
    title: string;
    urlOrPath: string;
    uploadedAt: string;
}

const DocumentsPage = () => {
    const { token } = useContext(AuthContext);
    const [documents, setDocuments] = useState<Document[]>([]);
    const [newDoc, setNewDoc] = useState({ projectId: "", title: "", file: null as File | null });

    const fetchDocuments = async () => {
        try {
            const res = await API.get("/documents", {
                headers: { Authorization: `Bearer ${token}` },
            });
            setDocuments(res.data);
        } catch (err) {
            console.error(err);
            alert("Failed to fetch documents");
        }
    };

    useEffect(() => {
        fetchDocuments();
    }, []);

    const handleFileChange = (e: ChangeEvent<HTMLInputElement>) => {
        if (e.target.files && e.target.files[0]) {
            setNewDoc({ ...newDoc, file: e.target.files[0] });
        }
    };

    const handleUpload = async (e: React.FormEvent) => {
        e.preventDefault();
        if (!newDoc.file) {
            alert("Select a file");
            return;
        }

        const formData = new FormData();
        formData.append("projectId", newDoc.projectId);
        formData.append("title", newDoc.title);
        formData.append("file", newDoc.file);

        try {
            await API.post("/documents", formData, {
                 headers: { Authorization: `Bearer ${token}`, "Content-Type": "multipart/form-data" },
            });
            setNewDoc({ projectId: "", title: "", file: null });
            fetchDocuments();
        } catch (err) {
            console.error(err);
            alert("File upload failed");
        }
    };

    const handleDelete = async (id: number) => {
        if (!window.confirm("Delete this document?")) return;
        try {
            await API.delete(`/documents/${id}`, {
                headers: { Authorization: `Bearer ${token}` },
            });
            fetchDocuments();
        } catch (err) {
            console.error(err);
            alert("Failed to delete document");
        }
    };

    return (
        <div className="container mt-5">
            <h2>Documents</h2>

            {/* Upload Form */}
            <form onSubmit={handleUpload} className="mb-4 row g-2">
                <div className="col-md-3">
                    <input
                        type="text"
                        placeholder="Project ID"
                        className="form-control"
                        value={newDoc.projectId}
                        onChange={(e) => setNewDoc({ ...newDoc, projectId: e.target.value })}
                        required
                    />
                </div>
                <div className="col-md-3">
                    <input
                        type="text"
                        placeholder="Title"
                        className="form-control"
                        value={newDoc.title}
                        onChange={(e) => setNewDoc({ ...newDoc, title: e.target.value })}
                        required
                    />
                </div>
                <div className="col-md-4">
                    <input type="file" className="form-control" onChange={handleFileChange} required />
                </div>
                <div className="col-md-2">
                    <button type="submit" className="btn btn-primary w-100">
                        Upload
                    </button>
                </div>
            </form>

            {/* Document List */}
            <table className="table table-striped">
                <thead>
                <tr>
                    <th>Project ID</th>
                    <th>Title</th>
                    <th>File</th>
                    <th>Uploaded At</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {documents.map((d) => (
                    <tr key={d.id}>
                        <td>{d.projectId}</td>
                        <td>{d.title}</td>
                        <td>
                            <a href={d.urlOrPath} target="_blank" rel="noopener noreferrer">
                                View
                            </a>
                        </td>
                        <td>{d.uploadedAt}</td>
                        <td>
                            <button className="btn btn-sm btn-danger" onClick={() => handleDelete(d.id)}>
                                Delete
                            </button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default DocumentsPage;
